import { createFeatureSelector, createSelector } from '@ngrx/store';
import { AppState } from '../app.state';


export const selectFeature = createSelector(
  (state: AppState) => state.timovi,
  (timovi) => timovi
);

// export const selectIgraciList = createSelector(
//   selectFeature,
//   (songs) => songs.list
// );



export const selectIgraciTeren = createSelector(
  selectFeature,
  (timState) => timState.igraciTeren
);

export const selectIgraciZamena = createSelector(
  selectFeature,
  (timState) => timState.igraciZamena
);
